import {Button} from '@material-ui/core';
import { Link } from 'react-router-dom';
import Navbar1 from './Navbar1';

const Home = () => {
  return (
    <div className="container2">
        <Navbar1/>
        <div className="menu">
            <p>fegrd</p>
        </div>
        <div className="devices">
            <p>fegrd</p>
        </div>
        <div className="analytics">
            <p>fegrd</p>
        </div>
    </div>
  );
};

export default Home;
